import { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { 
  registrationsList, 
  bookingsList, 
  toolsList, 
  feedbackList, 
  usersList, 
  sessionsSummary,
  sessionsList
} from '../../services/api';
import { 
  IconUsers as UsersIcon, 
  IconCalendar as CalendarIcon, 
  IconTools as ToolsIcon, 
  IconFeedback as FeedbackIcon, 
  IconEye as ActivityIcon,
  IconRefresh as RefreshIcon,
  IconSearch as SearchIcon,
  IconArrowRight as ArrowRightIcon
} from '../../components/Icons';
import '../../styles/dashboard.css';

const MetricCard = ({ icon, title, value, change, isIncrease }) => (
  <div className="metric-card">
    <div className="metric-icon">{icon}</div>
    <div className="metric-content">
      <div className="metric-title">{title}</div>
      <div className="metric-value">{value.toLocaleString()}</div>
      {change !== undefined && (
        <div className={`metric-change ${isIncrease ? 'increase' : 'decrease'}`}>
          {isIncrease ? '↑' : '↓'} {change}% from last month
        </div>
      )}
    </div>
  </div>
);

export default function AdminDashboard() {
  const [metrics, setMetrics] = useState({
    totalUsers: 2453,
    totalSessions: 5432,
    activeSessions: 189,
    totalBookings: 1234,
    totalTools: 89,
    totalFeedback: 345,
  });

  const [recentSessions, setRecentSessions] = useState([
    { id: 1, user: 'John Doe', time: '2 mins ago', status: 'active' },
    { id: 2, user: 'Jane Smith', time: '5 mins ago', status: 'active' },
    { id: 3, user: 'Robert Johnson', time: '12 mins ago', status: 'offline' },
    { id: 4, user: 'Emily Davis', time: '24 mins ago', status: 'offline' },
    { id: 5, user: 'Michael Brown', time: '1 hour ago', status: 'offline' },
  ]);

  const [loading, setLoading] = useState(false);

  useEffect(() => {
    const fetchData = async () => {
      try {
        setLoading(true);
        // In a real app, we would fetch this data from the API
        // For now, we'll use mock data to match the screenshot
        setMetrics({
          totalUsers: 2453,
          totalSessions: 5432,
          activeSessions: 189,
          totalBookings: 1234,
          totalTools: 89,
          totalFeedback: 345,
        });
      } catch (error) {
        console.error('Error fetching dashboard data:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  return (
    <div className="dashboard-container">
      <div className="dashboard-header">
        <h1>Dashboard</h1>
        <div className="header-actions">
          <button className="btn btn-outline">
            <SearchIcon size={16} /> Export
          </button>
          <button className="btn btn-primary">
            <ArrowRightIcon size={16} /> Add Widget
          </button>
        </div>
      </div>

      <div className="metrics-grid">
        <MetricCard 
          icon={<UsersIcon size={24} />} 
          title="Total Users" 
          value={metrics.totalUsers} 
          change={12.5} 
          isIncrease={true} 
        />
        <MetricCard 
          icon={<ActivityIcon size={24} />} 
          title="Active Sessions" 
          value={metrics.activeSessions} 
          change={8.3} 
          isIncrease={true} 
        />
        <MetricCard 
          icon={<CalendarIcon size={24} />} 
          title="Total Bookings" 
          value={metrics.totalBookings} 
          change={5.2} 
          isIncrease={true} 
        />
        <MetricCard 
          icon={<ToolsIcon size={24} />} 
          title="Tools Available" 
          value={metrics.totalTools} 
          change={2.1} 
          isIncrease={false} 
        />
      </div>

      <div className="dashboard-section">
        <div className="section-header">
          <h2>Recent Activity</h2>
          <button className="btn-text">
            <RefreshIcon size={16} /> Refresh
          </button>
        </div>
        <div className="card">
          <table className="dashboard-table">
            <thead>
              <tr>
                <th>User</th>
                <th>Activity</th>
                <th>Time</th>
                <th>Status</th>
                <th>Action</th>
              </tr>
            </thead>
            <tbody>
              {recentSessions.map((session) => (
                <tr key={session.id}>
                  <td>{session.user}</td>
                  <td>Logged in to dashboard</td>
                  <td>{session.time}</td>
                  <td>
                    <span className={`status-badge ${session.status}`}>
                      {session.status === 'active' ? 'Active' : 'Offline'}
                    </span>
                  </td>
                  <td>
                    <button className="btn-text">View</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>

      <div className="dashboard-section">
        <div className="section-header">
          <h2>Sessions Overview</h2>
          <div className="time-filter">
            <button className="btn-text active">Today</button>
            <button className="btn-text">Week</button>
            <button className="btn-text">Month</button>
          </div>
        </div>
        <div className="sessions-chart">
          <div className="chart-placeholder">
            <p>Sessions chart will be displayed here</p>
          </div>
        </div>
      </div>
    </div>
  );
}
